import { Text, View, StyleSheet } from 'react-native';
import { FlatList } from 'react-native-gesture-handler';


const tab_Course = [
    { id:"1",
      nom_produit : "Barre de Chocolat",
    },{ 
        id:"2",
      nom_produit:"Paquet de Lait"
    }, {

    }

]

class Liste_Course extends React.Component {
    render() {
        return (
            <View style={styles.container}> 
                <FlatList data={tab_Course} renderItem={({item}) => <Text>{item.nom_produit}</Text>} />
                <StatusBar style="auto" />
            </View>
        );
    }
}



const styles = StyleSheet.create({ container: { flex: 1, paddingTop: 20 } })

export default Liste_Course
